	        <div class="container" style="padding-top: 15vh;">
	          <center>
	            <h1 class="display-4" style="color: white">Novel Coronavirus(2019)</h1>
	            <p class="lead">By Chaitra GV on 09 September 2020 05:45 PM</p>
	          </center>
	        </div>
	      </div>

	      <div style="width: 100%;">
	         <div class="container" style="background: white; width: 80%; margin-left: 10%; padding-top: 30px;">
	            <p class="MsoNormal" style="margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span style="font-size: 11pt;">Highlights:-</span><br></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">On 31<sup>st</sup> December 2019, the WHO China Country Office was informed of cases of pneumonia<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">Unknown etiology detected in Wuhan City, Hubei Province of China. From 31<sup>st</sup> Dec 2019 through<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">3<sup>rd</sup> Jan 2020, a total of 44 case-patients with pneumonia of unknown etiology were reported to WHO<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">By the national authorities in China. During this reported period, the casual agent was not identified.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">On 13<sup>th</sup> Jan 2020, the Ministry of Public Health, Thailand reported the first imported case of lab-confirmed novel Coronavirus from Wuhan, Hubei Province, China.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">On 15<sup>th</sup> Jan 2020, Japan (MHLW) reported an imported case of laboratory-confirmed 2019-nCoV from<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">Wuhan, Hubei Province, China.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">On 20<sup>th</sup> Jan 2020, Korea reported the first case of 2019-nCoV in the republic of Korea.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">Cases infected in China have been exported to the US, Thailand, Japan and Republic of Korea.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">The government of the Singapore has scaled up the national Disease Outbreak Response System Condition (DORSCON) alert level from green to yellow (Level 2 out of 4-level national crisis management system) on 21<sup>st</sup> Jan 2020;<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">The basic principles to reduce the general risk of transmission of acute respiratory infections:<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">&nbsp; Avoiding close contact with people suffering from acute respiratory infections.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US"> Frequent hand-washing, especially after direct contact with ill people or their environment.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">5  Avoiding unprotected contact with farm or wild animals.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">6  People with symptoms of acute respiratory infection should practice cough etiquette (maintain distance, cover coughs and sneezes with disposable tissues or clothing, and wash hands).<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">During previous outbreaks due to other coronavirus (Middle-East Respiratory Syndrome (MERS) and the Severe Acute Respiratory Syndrome (SARS)), human to human transmission occurred through droplets, contact and fomites, suggesting that the transmission mode of the 2019-nCoV can be similar.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">To support country implementation of the protocols (FFX, HH), it is recommended to use the Go.Data field electronic tool for case and contacts data collection and management. The FFX and HH protocol questionnaire templates are available in Go.Data. Visit www.who.int/godata or contact godata@who.int for more information.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">Case definitions are included below.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><b><span lang="EN-US">Suspect case<o:p></o:p></span></b></p><p class="MsoListParagraphCxSpFirst" style="margin: 0cm 0cm 0.0001pt 36pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt;"><span lang="EN-US">A.<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;</span></span><span lang="EN-US">A patient with acute respiratory illness (fever and at least one sign/symptom of respiratory disease, e.g., cough, shortness of breath), AND a history of travel to or residence in a location reporting community transmission of COVID-19 disease during the 14 days prior to symptom onset.<o:p></o:p></span></p><p class="MsoListParagraphCxSpFirst" style="margin: 0cm 0cm 0.0001pt 36pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt;"><span lang="EN-US"><br></span></p><p class="MsoListParagraphCxSpMiddle" style="margin: 0cm 0cm 0.0001pt 36pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">OR<o:p></o:p></span></p><p class="MsoListParagraphCxSpMiddle" style="margin: 0cm 0cm 0.0001pt 36pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US"><br></span></p><p class="MsoListParagraphCxSpMiddle" style="margin: 0cm 0cm 0.0001pt 36pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt;"><span lang="EN-US">B.<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;</span></span><span lang="EN-US">A patient with any acute respiratory illness AND having been in contact with a confirmed or probable COVID-19 case (see definition of contact) in the last 14 days prior to symptom onset;&nbsp;</span></p><p class="MsoListParagraphCxSpMiddle" style="margin: 0cm 0cm 0.0001pt 36pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt;"><span lang="EN-US"><br></span></p><p class="MsoListParagraphCxSpMiddle" style="margin: 0cm 0cm 0.0001pt 36pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt;"><span lang="EN-US">&nbsp; &nbsp; &nbsp; OR<o:p></o:p></span></p><p class="MsoListParagraphCxSpMiddle" style="margin: 0cm 0cm 0.0001pt 36pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt;"><span lang="EN-US"><br></span></p><p class="MsoListParagraphCxSpLast" style="margin: 0cm 0cm 10pt 36pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt;"><span lang="EN-US">C.<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;</span></span><span lang="EN-US">A patient with severe acute respiratory illness (fever and at least one sign/symptom of respiratory disease, e.g., cough, shortness of breath; AND requiring hospitalization) AND in the absence of an alternative diagnosis that fully explains the clinical presentation.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt 18pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><b><span lang="EN-US">Probable case<o:p></o:p></span></b></p><p class="MsoListParagraphCxSpFirst" style="margin: 0cm 0cm 0.0001pt 36pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt;"><span lang="EN-US">A.<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;</span></span><span lang="EN-US">A suspect case for whom testing for the COVID-19 virus is inconclusive. a. Inconclusive being the result of the test reported by the laboratory.<o:p></o:p></span></p><p class="MsoListParagraphCxSpFirst" style="margin: 0cm 0cm 0.0001pt 36pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt;"><span lang="EN-US"><br></span></p><p class="MsoListParagraphCxSpMiddle" style="margin: 0cm 0cm 0.0001pt 36pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">OR<o:p></o:p></span></p><p class="MsoListParagraphCxSpMiddle" style="margin: 0cm 0cm 0.0001pt 36pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US"><br></span></p><p class="MsoListParagraphCxSpLast" style="margin: 0cm 0cm 10pt 36pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0); text-indent: -18pt;"><span lang="EN-US">B.<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;</span></span><span lang="EN-US">A suspect case for whom testing could not be performed for any reason.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt 18pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><b><span lang="EN-US">Confirmed case<o:p></o:p></span></b></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt 18pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">A person with laboratory confirmation of COVID-19 infection, irrespective of clinical signs and symptoms<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt 18pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">&nbsp; Technical guidance for laboratory testing can be found.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt 18pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><b><span lang="EN-US">&nbsp;Definition of contact<o:p></o:p></span></b></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt 18pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">A contact is a person who experienced any one of the following exposures during the 2 days before and the 14 days after the onset of symptoms of a probable or confirmed case:<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt 18pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">&nbsp;1. Face-to-face contact with a probable or confirmed case within 1 meter and for more than 15 minutes;<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt 18pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">&nbsp;2. Direct physical contact with a probable or confirmed case;<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt 18pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">3. Direct care for a patient with probable or confirmed COVID-19 disease without using proper personal protective equipment1 ; OR<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt 18pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">&nbsp;4. Other situations as indicated by local risk assessments.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt 18pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">&nbsp;Note: for confirmed asymptomatic cases, the period of contact is measured as the 2 days before through the 14 days after the date on which the sample was taken which led to confirmation.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt 18pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">Yemen is the worlds worst humanitarian emergency and the already vulnerable people of Yemen are facing the added threat of COVID-19. This new burden on medical facilities could result in a catastrophic death toll.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt 18pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">WHO recommends that any decision on mass gatherings should be based on a careful assessment of all risk factors associated with the event. Guidance documents and tools have been developed to this effect. Steps to be taken include risk evaluation, risk management and risk communication  the latter of which has the aim of sharing with communities the rationale for the decisions taken, the measures applied and any residual risk. Based on this risk-based approach, the decision may be taken to cancel a planned event or make it virtual. If, on the contrary, it is decided to proceed with an event, key precautions should be implemented, including basic measures for enforcing physical distancing of at least one meter (three feet) between people at all times, frequent hand cleaning, and respiratory etiquette.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt 18pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">Access to basic hand washing facilities is a key condition for schools to be able to operate safely in the midst of the COVID-19 pandemic. Yet the latest data from the WHO/UNICEF Joint Monitoring Programme (JMP) found that 43% of schools worldwide lacked access to basic hand washing with soap and water in 2019.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt 18pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">In the WHO Region of the Americas, the number of cases reported last week remained stable compared to the previous week, with a less than 1% increase in the number of newly confirmed cases.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt 18pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">South-East Asia is the second most affected region and currently accounts for a respective 26% and 19% of newly reported cases and deaths globally in the past seven days.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt 18pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">The number of cases reported in the European Region has gradually increased in recent weeks, however, there was no substantial change in the number of cases reported this week compared to the previous week.<o:p></o:p></span></p><p class="MsoNormal" style="margin: 0cm 0cm 10pt 18pt; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif; color: rgb(0, 0, 0);"><span lang="EN-US">South-East Asia has reported the largest week-on-week increase, largely due to increased case detections in India. India has reported nearly 500 000 new cases in the past seven days, a 9% increase compared to the previous seven days and the highest numbers of new cases globally. While these trends are concerning, the increase in cases should be seen against a substantive rise in testing in recent weeks.<o:p></o:p></span></p>
              
